export function ControllableParameters(){
	return [
		{"property":"LightingMode", "group":"lighting", "label":"Lighting Mode", "type":"combobox", "values":["Canvas", "Forced"], "default":"Canvas"},
		{"property":"forcedColor", "group":"lighting", "label":"Forced Color", "min":"0", "max":"360", "type":"color", "default":"009bde"},
		{"property":"EndpointMode", "group":"", "label":"Endpoint Mode", "type":"combobox", "values":["PrismRGB", "Arduino"]},
	];
}

const vKeyNames = [];
const vKeyPositions = [];

const Prism_STREAM    = 0x32;
const Prism_COMMIT    = 0x33;
const Prism_START     = 0x34;
const Prism_RESET     = 0x37;
const Prism_MODE      = 0x38;

const Prism_HARDWARE_MODE = 0x01;
const Prism_SOFTWARE_MODE = 0x02;
export function SupportsSubdevices(){ return true; }
const DeviceMaxLedLimit = 120;
export function LacksOnBoardLeds(){ return true;}



//Channel Name, Led Limit
let ChannelArray = [
	["Channel 1", 60],
	["Channel 2", 60],
];

function SetupChannels(){
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++){
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

export function Initialize() {
	SetupChannels();
}

export function Shutdown() {
	//channel 0
	let packet = [0x00, Prism_MODE, 0x00, Prism_HARDWARE_MODE];
	device.write(packet, 65);
	//channel 1
	packet = [0x00, Prism_MODE, 0x01, Prism_HARDWARE_MODE];
	device.write(packet, 65);
}

export function LedNames() {
	return vKeyNames;
}


export function LedPositions() {
	return vKeyPositions;
}


function SendChannel(Channel) {
	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).LedCount();
	let componentChannel = device.channel(ChannelArray[Channel][0]);

	let ColorData = [];

	if(LightingMode === "Forced"){
		ColorData = device.createColorArray(forcedColor, ChannelLedCount, "Seperate");

	}else if(componentChannel.shouldPulseColors()){
		ChannelLedCount = 120;

		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		ColorData = device.createColorArray(pulseColor, ChannelLedCount, "Seperate");

	}else{
		ColorData = device.channel(ChannelArray[Channel][0]).getColors("Seperate");
	}

	

	let RedChannelData = ColorData[0].map(x => x * .7);
	let GreenChannelData = ColorData[1].map(x => x * .7);
	let BlueChannelData = ColorData[2].map(x => x * .7);


	//Set up for update
	InitChannel(Channel);

	if(EndpointMode == "Arduino"){
		channelStart(Channel);
	}

	//Stream RGB Data
	let ledsSent = 0;
	ChannelLedCount = ChannelLedCount >= 120 ? 120 : ChannelLedCount;

	while(ChannelLedCount > 0){
		let ledsToSend = ChannelLedCount >= 50 ? 50 : ChannelLedCount;

		StreamLightingPacketChanneled(ledsSent, ledsToSend, 0, RedChannelData.splice(0, ledsToSend), Channel);

		StreamLightingPacketChanneled(ledsSent, ledsToSend, 1, GreenChannelData.splice(0, ledsToSend), Channel);

		StreamLightingPacketChanneled(ledsSent, ledsToSend, 2, BlueChannelData.splice(0, ledsToSend), Channel);

		ledsSent += ledsToSend;
		ChannelLedCount -= ledsToSend;
	}
}


export function Render() {
	SendChannel(0);
	device.pause(1);

	SendChannel(1);
	device.pause(1);

	SubmitLightingColors();

}


function InitChannel(channel){
	let packet = [0x00, Prism_MODE, channel, Prism_SOFTWARE_MODE];

	device.write(packet, 65);
	device.read(packet, 17);

}

function StreamLightingPacketChanneled(start, count, colorChannel, data, channel) {
	//channel selection == 32 0/1 Start Count Channel LEDS
	//(Start, Count, Color, Data)
	let packet = [0x00, Prism_STREAM, channel, start, count, colorChannel];
	packet = packet.concat(data);

	device.write(packet, 65);
	device.read(packet, 17);
}

function channelStart(channel){
	//start packet == 34 00 channel (len 64)
	let packet = [0x00, Prism_START, channel];

	device.write(packet, 65);
	device.read(packet, 17);
}

function channelReset(channel){
	let packet = [0x00, Prism_RESET, channel];

	device.write(packet, 65);
	device.read(packet, 17);
}


function SubmitLightingColors() {
	let packet = [0x00, Prism_COMMIT, 0xFF];

	device.write(packet, 65);
	device.read(packet, 17);
}


export function Validate(endpoint) {
	return endpoint.interface === -1 | 2;
}

